import './App.css';
import {Component} from "react"

class App extends Component {
  constructor() {
    super();

    this.state = {
      name: {firstname:"Lilio", lastname:"Segovia"},
      company: "Mathison Projects"
    }

  }
  render(){
  return (
    <div className="App">
      <header className="App-header">
        <p>hi {this.state.name}, I work at {this.state.company}</p>
        <button onClick={() => {
          this.setState({name:"David"})
        }}>Change Name</button>
       </header>
    </div>
  );
}

}

export default App;
